import React,{useEffect,useState} from "react";
import axios from "axios"
export default function Home()
{
    const [loginstate,setLoginState]= useState({name:'',email:''});
    useEffect(()=>{




        (

            async()=>
            {
    await axios.get('http://localhost:8089/api/auth/user',{
    withCredentials: true,
    headers: {
      "Access-Control-Allow-Origin": "http://localhost:8089",
      "Access-Control-Allow-Credentials": true
    }})
  .catch(e=>console.log("no worky"))
  .then((res)=>setLoginState({...res.data}))









    })()
})         


    return( 

    <div>
        Welcome Back {loginstate.name}
    </div> 

    );
}
